column3:
Buenas tardes ; 

 Por favor  de su colaboración con el siguiente pedido, se debe entregar en la instalaciones del cliente el día viernes en la mañana para inicio de obra el dia sábado. Numero de caso con el cual se realizo el kick off para TI CARE  es el 043331

 Los proveedores pueden entregar en la siguiente dirección: carrera 34 10-97

Buen día;

 Solicitamos de su acostumbrada ayuda, para solicitar una lista de equipos de cómputo alquilados por Massy y que aun se encuentren en custodia de Massy, con la fecha que se solicitó por favor.
 De antemano agradezco su pronta respuesta.
